sparqlQuery:
SELECT  (COUNT(DISTINCT ?uri) AS ?c)
WHERE
  { ?uri  a                     <http://dbpedia.org/ontology/Company>
      { ?uri  <http://dbpedia.org/ontology/industry>  <http://dbpedia.org/resource/Advertising> }
    UNION
      { ?uri  <http://dbpedia.org/ontology/industry>  ?industry
        FILTER regex(?industry, "advertising", "i")
      }
  }

SELECT DISTINCT  ?uri
WHERE
  { ?uri  a                     <http://dbpedia.org/ontology/President> ;
          <http://dbpedia.org/ontology/birthDate>  ?date
    FILTER regex(?date, "^1945")
  }

SELECT DISTINCT  ?uri
WHERE
  { ?uri  a                     <http://dbpedia.org/ontology/Company>
      { ?uri  <http://dbpedia.org/ontology/location>  <http://dbpedia.org/resource/Munich> }
    UNION
      { ?uri  <http://dbpedia.org/ontology/headquarter>  <http://dbpedia.org/resource/Munich> }
    UNION
      { ?uri  <http://dbpedia.org/ontology/locationCity>  <http://dbpedia.org/resource/Munich> }
  }

SELECT DISTINCT  ?uri
WHERE
  { ?uri  a                     <http://dbpedia.org/ontology/Automobile>
      { ?uri  <http://dbpedia.org/ontology/assembly>  <http://dbpedia.org/resource/Germany> }
    UNION
      { ?uri  <http://dbpedia.org/property/assembly>  <http://dbpedia.org/resource/Germany> }
    UNION
      {   { ?uri  <http://dbpedia.org/ontology/manufacturer>  ?x }
        UNION
          { ?uri  <http://dbpedia.org/property/manufacturer>  ?x }
          { ?x  <http://dbpedia.org/ontology/locationCountry>  <http://dbpedia.org/resource/Germany> }
        UNION
          { ?x  <http://dbpedia.org/ontology/location>  <http://dbpedia.org/resource/Germany> }
      }
  }

SELECT DISTINCT  ?uri
WHERE
  { ?uri  a                     <http://dbpedia.org/ontology/Volcano> ;
          <http://dbpedia.org/ontology/locatedInArea>  <http://dbpedia.org/resource/Japan> ;
          <http://dbpedia.org/ontology/eruptionYear>  ?date
    FILTER ( year(?date) >= 2000 )
  }

SELECT DISTINCT  ?uri
WHERE
  { ?uri  a                     <http://dbpedia.org/ontology/Airport>
      { ?uri  <http://dbpedia.org/ontology/location>  <http://dbpedia.org/resource/California> }
    UNION
      { ?uri  <http://dbpedia.org/ontology/city>  <http://dbpedia.org/resource/California> }
    UNION
      { ?uri   <http://dbpedia.org/ontology/city>  ?city .
        ?city  <http://dbpedia.org/ontology/isPartOf>  <http://dbpedia.org/resource/California>
      }
    UNION
      { ?uri  <http://dbpedia.org/ontology/operator>  <http://dbpedia.org/resource/California> }
  }

SELECT DISTINCT  ?uri
WHERE
  { ?uri  a                     <http://dbpedia.org/ontology/Company>
      { ?uri  <http://dbpedia.org/ontology/numberOfEmployees>  ?n }
    UNION
      { ?uri  <http://dbpedia.org/property/numEmployees>  ?n }
    FILTER ( ?n > 1000000 )
  }

SELECT DISTINCT  ?uri
WHERE
  { ?uri  a                     <http://dbpedia.org/ontology/Person>
      { ?uri  <http://dbpedia.org/ontology/office>  "Chancellor of Germany" }
    UNION
      { ?uri  <http://dbpedia.org/property/office>  <http://dbpedia.org/resource/Chancellor_of_Germany> }
  }

SELECT DISTINCT  ?uri
WHERE
  { ?uri  a                     <http://dbpedia.org/ontology/BasketballPlayer> ;
          <http://dbpedia.org/ontology/birthDate>  ?date ;
          <http://dbpedia.org/property/highlights>  ?h
    FILTER regex(?h, "MVP")
  }
ORDER BY DESC(?date)
OFFSET  0
LIMIT   4

SELECT DISTINCT  ?uri
WHERE
  { ?uri  a                     <http://dbpedia.org/ontology/Writer>
      { ?uri  <http://dbpedia.org/ontology/almaMater>  ?x }
    UNION
      { ?uri  <http://dbpedia.org/ontology/education>  ?x }
      { ?x  <http://dbpedia.org/ontology/city>  <http://dbpedia.org/resource/Istanbul> }
    UNION
      { ?x  <http://dbpedia.org/property/city>  <http://dbpedia.org/resource/Istanbul> }
  }
